import binascii
import zlib
import gzip

characters = []

with open("chall.txt", "r") as file:
    while line := file.readline():
        for c in line:
            characters.append(c)

# There are 256 distinct characters in chall.txt so we essentially create a
# a chart of encodings like e.g.:
# https://upload.wikimedia.org/wikipedia/commons/1/1b/ASCII-Table-wide.svg)
sorted_distinct_characters = sorted(    # sort the list
  list(                                 # cast them to a list
    set(characters)                     # capture unique values (256)
  )
)

# We then index into our chart to derive values 0-255 which we can cast to
# hex values
values = []
for c in characters:
  values.append(hex(sorted_distinct_characters.index(c)))

print(values[:12]);

# The initial hex ends up as:              FF 8D FF E0 00 10 A4 64 94 64 00 10
# which is close to JPEGs file signature:  FF D8 FF E0 00 10 4A 46 49 46 00 01
# Doing a nibble swap will produce data that can be read as a jpeg file
swapped = []
for n in values:
  x = int(n,16)
  swapped.append((
    (x & 0xF0) >> 4)        # get the high nibble and shift right
    |                       # this OR ensures both swaps happen
    (x & 0x0F) << 4         # get the low nibble and shift left
  )

print([hex(x) for x in swapped[:12]])   # jpeg signature

# save this image to file
# we'll then run it through a Piet interpreter
with open("piet_file.jpg", "wb") as file:
    file.write(bytes(swapped))

# finding a convenient and working piet interpreter is difficult but 
# this suspicious string appears in the resulting jpeg
evil = ''

# the following is a very light-weight interpreter for the esolang evil
# it implements only the characters that appear in the above string
def weave(reg):
  # print('weaving: ', reg)
  shifted = (
      (reg >> 0 & 1) << 2 |   # Bit 0 is moved to bit 2
      (reg >> 1 & 1) << 0 |   # Bit 1 is moved to bit 0
      (reg >> 2 & 1) << 4 |   # Bit 2 is moved to bit 4
      (reg >> 3 & 1) << 1 |   # Bit 3 is moved to bit 1
      (reg >> 4 & 1) << 6 |   # Bit 4 is moved to bit 6
      (reg >> 5 & 1) << 3 |   # Bit 5 is moved to bit 3
      (reg >> 6 & 1) << 7 |   # Bit 6 is moved to bit 7
      (reg >> 7 & 1) << 5     # Bit 7 is moved to bit 5
  )
  # print('woven: ', shifted)
  return shifted


register = 0
result = []
for c in evil:
    # print('current char:', c)
    if c == 'a':
        register += 1
    elif c == 'u':
        register -= 1
    elif c == 'w':
        result.append(chr(register))
    elif c == 'e':
        register = weave(register)
    elif c == 'z':
        register = 0
    # print('computed register: ', register)

hex_as_str = ''.join(result)
hex_data = binascii.unhexlify(hex_as_str)
decompressed = zlib.decompress(hex_data)
super_decompressed = gzip.decompress(decompressed)
# open('decompressed', 'wb').write(super_decompressed)
nya = []
unique = {}
for c in super_decompressed:
  nya.append(chr(c))
  if chr(c) in unique.keys():
    unique[chr(c)] += 1
  else:
    unique[chr(c)] = 1

print(unique)
nya_trunc = []
for h in nya:
  if (h == 'ÿ') | (h == 'À'):
    nya_trunc.append(h)

nya_output = []
n_reg = 0
for o in nya_trunc:
  if o == 'À':
    nya_output.append(n_reg)
  elif o == 'ÿ':
    n_reg += 1

print(nya_output)